import React from "react";

const Footer = () => {
  return (
    <div className="footer">
      <footer>
        <li>상호명</li>
        <li>대표이사</li>
        <li>서울시 서초구 사평대로 52길 9-2</li>
        <li>사업자 등록번호</li>
      </footer>
    </div>
  );
};

export default Footer;
